  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Rancher Agent 参数',
	description: 'ancher 在每个节点上部署一个 Agent 来与节点通信。本页描述了可以传递给 Agent 的选项。要使用这些选项，您需要使用自定义节点创建集群，并在添加节点时将选项添加到生成的`docker run`命令中。',
	keywords: [
		'rancher 2.0中文文档',
		'rancher 2.x 中文文档',
		'rancher中文',
		'rancher 2.0中文',
		'rancher2',
		'rancher教程',
		'rancher中国',
		'rancher 2.0',
		'rancher2.0 中文教程',
		'创建集群',
		'自定义集群',
		'Rancher Agent 参数'
	]
};
export const metadata = {
  "id": "rancher2/cluster-provisioning/rke-clusters/custom-nodes/agent-options/_index",
  "title": "Rancher Agent 参数",
  "description": "ancher 在每个节点上部署一个 Agent 来与节点通信。本页描述了可以传递给 Agent 的选项。要使用这些选项，您需要使用自定义节点创建集群，并在添加节点时将选项添加到生成的`docker run`命令中。",
  "source": "@site/docs/rancher2/cluster-provisioning/rke-clusters/custom-nodes/agent-options/_index.md",
  "permalink": "/docs/rancher2/cluster-provisioning/rke-clusters/custom-nodes/agent-options/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher2/cluster-provisioning/rke-clusters/custom-nodes/agent-options/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: '通用选项',
  id: '通用选项',
  children: []
}, {
  value: '角色选项',
  id: '角色选项',
  children: []
}, {
  value: 'IP 地址选项',
  id: 'ip-地址选项',
  children: [{
    value: '动态获取 IP 地址',
    id: '动态获取-ip-地址',
    children: []
  }]
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher 在每个节点上部署一个 Agent 来与节点通信。本页描述了可以传递给 Agent 的选项。要使用这些选项，您需要`}<a parentName="p" {...{
        "href": "/docs/rancher2/cluster-provisioning/rke-clusters/custom-nodes/_index"
      }}>{`使用自定义节点创建集群`}</a>{`，并在添加节点时将选项添加到生成的`}<inlineCode parentName="p">{`docker run`}</inlineCode>{`命令中。`}</p>
    <p>{`有关 Rancher 如何使用 Node Agent 与下游集群通信的概述，请参阅`}<a parentName="p" {...{
        "href": "/docs/rancher2/overview/architecture/_index"
      }}>{`产品架构`}</a>{`。`}</p>
    <h2 {...{
      "id": "通用选项"
    }}>{`通用选项`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`参数`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`环境变量`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--server`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_SERVER`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`已配置的 Rancher `}<inlineCode parentName="td">{`server-url`}</inlineCode>{`，Agent 将通过这个地址连接 Server。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--token`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_TOKEN`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`在 Rancher 中注册节点所需的 token。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--ca-checksum`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_CA_CHECKSUM`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`使用已配置的 Rancher`}<inlineCode parentName="td">{`cacerts`}</inlineCode>{`进行 SHA256 校验和来验证`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--node-name`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_NODE_NAME`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`重写注册节点的主机名（默认为`}<inlineCode parentName="td">{`hostname -s`}</inlineCode>{`)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--label`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_NODE_LABEL`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`向节点添加节点标签。对于多个标签，请传递额外的`}<inlineCode parentName="td">{`--label`}</inlineCode>{`选项。(`}<inlineCode parentName="td">{`--label key=value`}</inlineCode>{`)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--taints`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_NODE_TAINTS`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将节点 taints 添加到节点。对于多个 taints，请传递额外的`}<inlineCode parentName="td">{`--taints`}</inlineCode>{`选项。(`}<inlineCode parentName="td">{`--taints key=value:effect`}</inlineCode>{`)`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "角色选项"
    }}>{`角色选项`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`参数`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`环境变量`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--all-roles`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`ALL=true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将所有角色(`}<inlineCode parentName="td">{`etcd`}</inlineCode>{`,`}<inlineCode parentName="td">{`controlplane`}</inlineCode>{`,`}<inlineCode parentName="td">{`worker`}</inlineCode>{`)应用到节点`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--etcd`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`ETCD=true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将角色`}<inlineCode parentName="td">{`etcd`}</inlineCode>{`应用到节点`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--controlplane`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CONTROL=true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将角色`}<inlineCode parentName="td">{`controlplane`}</inlineCode>{`应用到节点`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--worker`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`WORKER=true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将角色`}<inlineCode parentName="td">{`worker`}</inlineCode>{`应用到节点`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "ip-地址选项"
    }}>{`IP 地址选项`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`参数`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`环境变量`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_ADDRESS`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`该节点将注册的 IP 地址（默认为用来连接 `}<inlineCode parentName="td">{`8.8.8.8`}</inlineCode>{`的 IP)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--internal-address`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`CATTLE_INTERNAL_ADDRESS`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`私有网络上用于主机间通信的 IP 地址`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "动态获取-ip-地址"
    }}>{`动态获取 IP 地址`}</h3>
    <p>{`出于自动化的目的，您不能在命令中指定节点 IP 地址，因为它必须是通用的才能用于每个节点。为此，我们有动态 IP 地址选项。它们用作现有 IP 地址选项的值。支持`}<inlineCode parentName="p">{`--address`}</inlineCode>{`和`}<inlineCode parentName="p">{`--internal-address`}</inlineCode>{`。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`值`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`例子`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`接口名称`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address eth0`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将从给定的接口中检索第一个配置的 IP 地址`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`ipify`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address ipify`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`https://api.ipify.org`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`awslocal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address awslocal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/latest/meta-data/local-ipv4`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`awspublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address awspublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/latest/meta-data/public-ipv4`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`doprivate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address doprivate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/metadata/v1/interfaces/private/0/ipv4/address`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`dopublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address dopublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/metadata/v1/interfaces/public/0/ipv4/address`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`azprivate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address azprivate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/metadata/instance/network/interface/0/ipv4/ipAddress/0/privateIpAddress?api-version=2017-08-01&format=text`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`azpublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address azpublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://169.254.169.254/metadata/instance/network/interface/0/ipv4/ipAddress/0/publicIpAddress?api-version=2017-08-01&format=text`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`gceinternal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address gceinternal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://metadata.google.internal/computeMetadata/v1/instance/network-interfaces/0/ip`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`gceexternal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address gceexternal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`http://metadata.google.internal/computeMetadata/v1/instance/network-interfaces/0/access-configs/0/external-ip`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`packetlocal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address packetlocal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`https://metadata.packet.net/2009-04-04/meta-data/local-ipv4`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`packetpublic`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`--address packetlocal`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`从`}<inlineCode parentName="td">{`https://metadata.packet.net/2009-04-04/meta-data/public-ipv4`}</inlineCode>{`获取的值将被使用`}</td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
